ghran\n","\n","- These three lexicons make use of the unigrams. Unigrams are a type of n-gram model that consists of a sequence of 1 item, that is, a word collected from a given textual data.\n","\n","- In the AFINN lexicon model scores the words in a range from -5 to 5. The increase in negativity corresponds the negative sentiment whereas an increase in positivity corresponds the positive one. \n","- The bing lexicon model on the other hand, classifies the sentiment into a binary category of negative or positive. \n","- The loughran model that performs analysis of the shareholder’s reports. In this project, we will make use of the bing lexicons to extract the sentiments out of our data. \n","\n","#### Reference: [ScienceDirect](https://www.sciencedirect.com/science/article/abs/pii/S095741741830143X)"]},{"cell_type":"markdown","id":"cfef1f70","metadata":{"papermill":{"duration":0.011223,"end_time":"2024-05-20T11:33:26.94825","exception":false,"start_time":"2024-05-20T11:33:26.937027","status":"completed"},"tags":[]},"source":["# Sentiments"]},{"cell_type":"markdown","id":"00d9f864","metadata":{"papermill":{"duration":0.01043,"end_time":"2024-05-20T11:33:26.968866","exception":false,"start_time":"2024-05-20T11:33:26.958436","status":"completed"},"tags":[]},"source":["## We can retrieve these lexicons using the get_sentiments() function. We can implement this as follows:"]},{"cell_type":"code","execution_count":4,"id":"c2110b72","metadata":{"execution":{"iopub.execute_input":"2024-05-20T11:33:26.993504Z","iopub.status.busy":"2024-05-20T11:33:26.991398Z","iopub.status.idle":"2024-05-20T11:33:27.068527Z","shell.execute_reply":"2024-05-20T11:33:27.06657Z"},"papermill":{"duration":0.092424,"end_time":"2024-05-20T11:33:27.071354","exception":false,"start_time":"2024-05-20T11:33:26.97893","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 6786 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>word</th><th sc